export interface Chef {
    name: string;
    age: number;
    married: boolean;
    children?: [
        {
            name: string;
            age: number;
            gender: string;
        }
    ]
}

export const chefs:Chef[] = [
    {   
        age: 54,
        married: true,
        name: 'yossi',
        children: [
          {
            age: 14,
            name: 'matan',
            gender: 'male'
          }
        ]
    },
    {   
        age: 62,
        married: false,
        name: 'jack',
    },
]
